import { useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import { useEffect } from "react";
const Profile = () => {
  const user = useSelector((state) => state.user);
  const navigate = useNavigate()
  if(user.sessionData.loggedIn === false) {
    navigate("/login")}
  useEffect( () => {
    if(user.sessionData.loggedIn === false) {
    navigate("/login")
  }
  },[])
  console.log(user.users[user.sessionData.email].password === user.sessionData.password ? user.users[user.sessionData.email] : false);
  return <div>

    email: {user.sessionData.email} <br/>
    password: {user.sessionData.password} <br/>
    gender: {user.users[user.sessionData.email].gender} <br/>
    name: {user.users[user.sessionData.email].name} <br/>
    lastName: {user.users[user.sessionData.email].lastName} <br/>



  </div>
}
export default Profile
